import { Container, Nav, Navbar, NavDropdown } from "react-bootstrap";

export const Header = () => {
  const genres = [
    {
      id: 2,
      name: "Point-and-click",
    },
    {
      id: 4,
      name: "Fighting",
    },
    {
      id: 5,
      name: "Shooter",
    },
    {
      id: 7,
      name: "Music",
    },
    {
      id: 8,
      name: "Platform",
    },
    {
      id: 9,
      name: "Puzzle",
    },
    {
      id: 10,
      name: "Racing",
    },
    {
      id: 11,
      name: "Real Time Strategy (RTS)",
    },
    {
      id: 12,
      name: "Role-playing (RPG)",
    },
    {
      id: 13,
      name: "Simulator",
    },
    {
      id: 14,
      name: "Sport",
    },
    {
      id: 15,
      name: "Strategy",
    },
    {
      id: 16,
      name: "Turn-based strategy (TBS)",
    },
    {
      id: 24,
      name: "Tactical",
    },
    {
      id: 25,
      name: "Hack and slash/Beat 'em up",
    },
    {
      id: 26,
      name: "Quiz/Trivia",
    },
    {
      id: 30,
      name: "Pinball",
    },
    {
      id: 31,
      name: "Adventure",
    },
    {
      id: 32,
      name: "Indie",
    },
    {
      id: 33,
      name: "Arcade",
    },
    {
      id: 34,
      name: "Visual Novel",
    },
    {
      id: 35,
      name: "Card & Board Game",
    },
    {
      id: 36,
      name: "MOBA",
    },
  ];

  return (
    <Navbar
      collapseOnSelect
      expand="lg"
      bg="dark"
      variant="dark"
      className="mb-3"
    >
      <Container>
        <Navbar.Brand href="/">PlayList</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#features">Recommended Games</Nav.Link>
            <Nav.Link href="/top100">Top 100</Nav.Link>
            <Nav.Link href="/upcoming">Upcoming Games</Nav.Link>
            <NavDropdown
              title="Genres"
              id="collasible-nav-dropdown"
              menuVariant="dark"
            >
              {genres.map((item) => (
                <NavDropdown.Item href={`/search?genre=${item.id}`}>
                  {item.name}
                </NavDropdown.Item>
              ))}
            </NavDropdown>
          </Nav>
          <Nav>
            <Nav.Link>Find your all favorite games in one place!</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
